class CsvFile(object):
	def __init__(self, name):
		self.name = name
		self.data = []
		self.columns = []
	def __str__(self):
		return self.name

	def empty(self):
		self.data = []

	def fill(self):
		self.data = [x for x in csv.DictReader(open(self.name, 'rU'))]
		self.columns = self.data[0].keys()

class Company(object):
	def __init__(self, name, symbol):
		self.name = name
		self.symbol = symbol
	def __unicode__(self):
		return self.symbol

