	data_keys = ['company', 'year', 'sma']
	for x in data_keys:
		if x not in request.POST or request.POST.get(x,False) == "":
			#invalid
			return render(request, 'myapp/algo.html', {'companies':company_names})
		if x == 'year' or x =='number':
			try:
				temp = int(request.POST.get(x,False) )
			except ValueError:
				return render(request, 'myapp/algo.html', {'error': 'You must enter a number for %s'%x, 'companies':company_names})
	company, year, sma = request.POST.get('company',False),request.POST.get('year',False),request.POST.get('sma',False)
	return run_algorithm(request, company, year, sma)








